import styled from 'styled-components'

export const Container = styled.div`
	padding: 30px 0 0 0;
`;

export const ImageProfile = styled.img`
	width: 50px;
	display: block;
	margin: 0 auto;
	border-radius: 50%;
`;

export const TextName = styled.img`

`;

export const TextEmail = styled.img`

`;
